import Card from "react-bootstrap/Card";

import "./Admin.css";
import CreateMis from "./CreateMis";

const admin = () => {
  return (
    <div className="admin">
      <Card>
        <Card.Header className="cardTitle">
          Create Solidarity Institution
        </Card.Header>
        <Card.Body>
          <Card.Text></Card.Text>
          <Card.Text></Card.Text>
        </Card.Body>
      </Card>
      <CreateMis />
    </div>
  );
};

export default admin;
